import { Data, Params } from 'src/request/entity.d';
import { put, post } from "src/request/api"
export const queryPages = (params: Params) => {
 const header = 'application/x-www-form-urlencoded;charset=utf-8'
 return put('/api/v1/app/mine/query-trans-log', params, header)
}
export const statistics = (data: Data) => {
 const header = 'application/x-www-form-urlencoded;charset=utf-8'
 return put('/api/v1/app/mine/query-coin-statistics', data, header)
}
